import './appInfo.scss';

const AppInfo = ({musicians, increased}) => {
    return(
        <div className="app-info">
            <h1>WomanUp ToDo List</h1>
            <h2>Общее число задач: {musicians}</h2>
            <h2>Выполненных задач: {increased}</h2>
        </div>
    );
}

export default AppInfo;
